import React from "react";

interface Pet {
  id: string;
  imageUrl: string;
  title: string;
  description: string;
  createdAt: string;
}

const ImageCard: React.FC<{ pet: Pet }> = ({ pet }) => {
  return (
    <div>
      <img src={require(`../img/${pet.imageUrl}`)} alt={pet.title} />
      <h3>{pet.title}</h3>
      <p>{pet.description}</p>
      <p>{new Date(pet.createdAt).toLocaleDateString()}</p>
    </div>
  );
};

export default ImageCard;
